INSERT INTO illness (id, name, sypthoms, treatment) VALUES (1, 'кошачья чумка', 'Угнетение животного, повышение температуры тела до 40-41° С, рвота, иногда жидким стулом. Рвотные массы сначала водянисто-желтые или коричневатые, позже становятся слизистыми, часто с примесью крови. Одновременно или спустя короткое время развивается понос. Фекалии жидкие, зловонные, бесцветные, желтоватые с примесью крови, иногда с хлопьями фибрина. Позы и поведение пациентов свидетельствуют о сильной болезненности в области живота и паха. Больные животные ищут укромные темные, при лихорадке прохладные, а при выздоровлении — теплые места, лежат на животе с запрокинутой головой и вытянутыми конечностями или сидят, сгорбившись в темном месте или над миской с водой, но не пьют. Во время болезни аппетит полностью исчезает. При прощупывании живота отмечают увеличение лимфоузлов брыжейки, кишечные петли малоподвижны, болезненны, утолщены, по структуре напоминают резиновую трубку, иногда растянуты жидкостью и газами. При аускультации прослушиваются звуки плеска, воркования или урчания. Часто при пальпации живота появляется рвота.', 'Введение внутримышечно противовирусного препарата широкого спектра действия Фоспренила: по 0,5 мл при весе кошки более 1 кг, при меньшей массе доза 0,2 мл. Лечение проводится 15 дней. Симптоматическая терапия направлена на устранение обезвоживания, интоксикации, спазмов и воспалений. Животному ставятся капельницы с раствором рингера и регидрона. Назначаются противорвотные препараты, такие как Церукал, и спазмолитики: Но-шпа (дротаверин), Дибазол. Все препараты вводятся инъекционно. Воспаления устраняют антибиотиками. Для улучшения работы иммунитета назначаются иммуномодуляторы, витаминно-минеральные комплексы. Дополнительно показано проведение курса железосодержащих препаратов. Язвы, образовывающиеся в ротовой полости, носу и на веках, протирают хлоргексидином. Допускается чередование антисептика с крепким отваром календулы.');
INSERT INTO illness (id, name, sypthoms, treatment) VALUES (2, 'бешенство', 'Животное может потерять аппетит, начать прятаться по укромным местам, или наоборот, проявлять невиданную прежде ласку. Часто симптомом на продромальной стадии является поедание несъедобных предметов: мебели, обоев, игрушек, веток. Вторая стадия носит стихийный характер: внезапные нападения на человека, мощные укусы, кусание любых предметов вплоть до поломки зубов, грызётся всё, что попадается кошке на глаза. Стадия длится от двух часов до нескольких дней. В это время кот много и часто мяукает из-за спазма гортани, голос изменён. Кот не способен проглотить ни слюну, ни пищу, ни воду. Вскоре нижняя челюсть парализуется, и пасть становится приоткрытой. Заключительная стадия длится до 5 дней. Начиная с нижней челюсти и хвоста, наступает паралич всего тела. Кошка не ест, не пьёт, не мяукает и сильно теряет в весе. После уже наступает смерть.', 'Усыпление');
INSERT INTO illness (id, name, sypthoms, treatment) VALUES (3, 'сальмонеллез', 'Заболевание сопровождается резким повышением температуры до 41 градуса, возникновением сильного поноса, рвоты. Рвотные массы имеют тягучую консистенцию, перед началом рвоты у кошки отделяется большое количество слюны. Кал имеет зловонный запах, примеси крови, иногда окрашен в черный цвет, что обусловлено перевариванием крови. Значительное повышение температуры может сопровождаться развитием судорог. При попытке прощупать живот кот активно сопротивляется из-за сильных болевых ощущений. Выделяя токсины, сальмонеллы повышают проницаемость стенок кишечника, что ведет к проникновению патогенной и условно-патогенной флоры в кровоток. Наличие гнойных выделений на носу и в глазах. Тяжелое дыхание, связанное с быстро развивающейся бронхопневмонией. Возможен кашель. Отказ от еды. Полная апатия к происходящему вокруг.', 'Антибиотики и лекарства группы сульфаниламидов (Бисептол, Сульфален, Окситетрациклин, Левомицетин). Курс антибиотикотерапии составляет 7-10 дней. Фуразолидин. Антигистаминные и глюкокортикоидные средства.');
INSERT INTO illness (id, name, sypthoms, treatment) VALUES (4, 'инфекционная анемия', 'Животное быстро теряет вес, аппетит падает, устает моментально, старается больше лежать и отдыхать, слизистые оболочки бледнеют из-за анемии. Нередко слизистые оболочки и белки глаз желтеют (развивается желтуха, страдает печень). Температура зачастую остается в норме, но может и повышаться. Пульс и дыхание учащаются.', 'Антибиотики тетрациклинового ряда дважды в сутки на протяжении длительного времени (пока в крови не останется возбудителей). Также применяется левомицетин дважды — трижды в день. Препараты, которые стимулируют выработку кровяных телец, помогают восстановить кроветворные органы. Хорошие результаты дает введение синтетических глюкокортикоидов.');
INSERT INTO illness (id, name, sypthoms, treatment) VALUES (5, 'кандидоз', 'При поражении ушей: зуд в области ушей, встряхивание головой, чрезмерное образование серы. При поражении ротовой полости: повышенное слюнотечение. При поражении мочевыводящей системы: цистит, затрудненное мочеиспускание. При поражении кожи: покраснение и раздражение кожи, язвы, зуд, перхоть, выпадение волос. При любой локализации кандидоза на пораженной поверхности образуются творожистые, белые хлопья.', 'Местные препараты (шампуни, мази), содержащие нитрат миконазола, кетоконазол, итраконазол или флуконазол.');
INSERT INTO illness (id, name, sypthoms, treatment) VALUES (6, 'гистоплазмоз', 'Отсутствие аппетита. Потеря веса. Побледнение слизистых. Затрудненное дыхание. Кашель. Свистящее дыхание. Хромота. Выделения из глаз. Диарея. Рвота. Лихорадка. Увеличение лимфоузлов', 'Флуконазол, кетоконазол, итраконазол либо амфотерицин');
INSERT INTO illness (id, name, sypthoms, treatment) VALUES (7, 'блохи', 'Животные начинают постоянно чесаться, тереться об углы стен, мебели и об пол, пытаются вычесать и выгрызть паразитов из шерсти, они становятся беспокойными. Ухудшается состояние шерстяного покрова. Он становится блеклым, шерсть начинает выпадать, появляются залысины. На коже образуются царапины и ссадины.', 'Выведение блох');
INSERT INTO illness (id, name, sypthoms, treatment) VALUES (8, 'клещи', 'Отказ кошки от предлагаемого корма, исхудание. Повышение температуры тела. Кошка становится вялой и апатичной. Появляется понос (понос у кошки) и рвота (рвота у кошек), которые вызывают у кошки обезвоживание. Одышка, кашель (кашель у кошки). Анемия (анемия у кошек). Кровь в моче (кровь в моче у кошки). Желтушность видимых слизистых оболочек (желтуха).', 'Демос, амитразин, амит- форте, ивермек – гель, капли на холку.');
INSERT INTO illness (id, name, sypthoms, treatment) VALUES (9, 'власоеды', 'Кошка постоянно вылизывается, остервенело чешется, вгрызается в шерсть зубами; При осмотре на теле кошки обнаруживаются расчесанные места, ранки, следы укусов; Появились участки тела, где выпала шерсть, проплешинки.', 'Капли (Барьер, Барс, Чистотел, Frontline, Hartz); спреи (Акаромектин, Больфо, Frontline); специальные шампуни (Больфо, Демос Люкс, Барс); эмульсии (Бионикс, Мериал).');
INSERT INTO illness (id, name, sypthoms, treatment) VALUES (10, 'сахарный диабет', 'Повышенная жажда. Клинический признак обусловлен высокой концентрацией в крови глюкозы, на расщепление которой не хватает инсулина. Выделительная система организма не справляется с нагрузкой, сахар появляется в моче, ее объем увеличивается. Процесс сопровождается обезвоживанием и повышенной жаждой больного животного. Полиурия. Частое мочеиспускание носит безболезненный характер. Изменение аппетита. При этом наблюдается как усиление, так и ослабление аппетита. Повышение массы тела. Шерсть тусклая, питомец постоянно линяет, выглядит неряшливо. Нарушение пищеварения: рвота, понос. Тахикардия. Частота сердечных сокращений резко увеличивается. Слабость, вялость животного. Шаткая и неуверенная походка. При развитии интоксикации резкий запах ацетона от кошки. Пахнуть может изо рта животного, а также моча и кожа. В запущенных случаях возможны судороги, обмороки, потеря сознания животным.', 'При диабете первого типа в обязательном порядке назначаются препараты инсулина короткого действия. В случае развития болезни по второму типу гормоны могут быть заменены сахароснижающими препаратами, или инсулин среднего или длительного действия.');
INSERT INTO illness (id, name, sypthoms, treatment) VALUES (11, 'мочекаменная болезнь', 'Питомец чаще ходит в туалет, причем иногда в неположенных местах. Мочеиспускание происходит в напряженной позе. Находясь в лотке, кошка мяукает от боли, причиняемой камнями. Из-за присутствия кровяных клеток моча становится розовой. Кот дольше, чем обычно, вылизывает себя под хвостом.', 'Купировать болевой эффект; Восстановить мочеиспускание; Снять интоксикацию организма; Провести антибактериальную терапию.');
INSERT INTO illness (id, name, sypthoms, treatment) VALUES (12, 'выпадение прямой кишки', 'Частые позывы к дефекации, болезненные ощущения при дефекации или мочеиспускании, кровотечения слизистых оболочек, активное вылизывание поврежденной области, визуально заметные каловые массы (вне акта дефекации), цвет которых может быть от розовых до черных, в зависимости от давности выделения.', 'Мануальное (ручное) вправление. Ампутация выпавшего участка прямой кишки. Колопексия.');
INSERT INTO illness (id, name, sypthoms, treatment) VALUES (13, 'воспаление параанальных желез', 'Постоянное вылизывание ануса и корня хвоста;  болезненность дефекации, сопровождающаяся жалобным мяуканьем; неуклюжая походка; хвост опущен, прижат к анусу, имеет неопрятный, «сальный» вид; утрачивается аппетит, животное угнетено, не участвует в играх, старается больше лежать; ездит на попе по полу или ковровому покрытию; от кошки дурно пахнет; при осмотре обнаруживают увеличенные железы, которые в норме незаметны.', 'Чистка параанальных желез у кошек Промывание параанальных желёз Удаление желез у котов');
INSERT INTO illness (id, name, sypthoms, treatment) VALUES (14, 'аллергия', 'Покраснение кожи или кожная сыпь различной локализации; зуд, видимые расчесы, облысения, отечность отдельных участков тела; чихание, истечения из носа и/или глаз; шелушение подушечек лап, экземы в межпальцевом пространстве; одышка; рвота; иногда повышение температуры тела; возможны отеки дыхательных путей; анафилактический шок (в очень редких случаях).', 'Изоляция от аллергенов, устранение возникших симптомов и предотвращение появления новых признаков. В зависимости от причины и формы заболевания, может потребоваться корректировка питания и медикаментозная терапия. ');
INSERT INTO illness (id, name, sypthoms, treatment) VALUES (15, 'астма', 'Обеспокоенное поведение, метание из угла в угол; характерная поза при приступе: согнутые лапы, опущена голова, тяжелое дыхание при открытом рте; резкий приступ удушья; надрывный кашель; хрип со свистом; утомленность после приступа, вялость.', 'Основой терапии являются расширяющие препараты в форме аэрозоля и имеющие предназначение купировать приступ; возможно применение гормональных препаратов для лечения воспалительных процессов в дыхательных путях; иногда назначаются препараты-антибиотики; важно применение витаминных комплексов для поддержания иммунитета.');
INSERT INTO illness (id, name, sypthoms, treatment) VALUES (16, 'инсульт', 'Склоненная голова под «странным» углом – чаще всего на какой-то бок. Нарушение координации движения.Атаксия – невозможность кошкой выполнять обычные рутинные свои движения из-за мышечной слабости во всем теле. Перемены в поведении, дезориентация, необъяснимый страх. После инсульта кот становится в прямом смысле нелогичным и необычным. Отмечается замешательство, питомец может избегать хозяев или даже на них бросаться, где-то прятаться от испуга. Может развиваться временная слепота – кошка после инсульта явно будет натыкаться на предметы, падать с предметов (мебель, пороги), не сразу находить миски с едой. Внезапная вялость. Снижение или полная потеря аппетита. Так же вероятны потери сознания при наклонении голову к посуде с едой. Асимметричное изменение размеров зрачков (анизокирия). Непроизвольное мочеиспускание и/или опорожнение кишечника. Резкие тики глазных яблок в бок туда-сюда (нистагм). Внезапная потеря сознания, длящаяся от нескольких секунд до 5-ти минут. У кошки после инсульта могут наблюдаться судороги конечностей и/или их паралич. Затрагивается обычно какая-то одна половина тела. Признаки нарушения дыхания, рвотные позывы, эпилептические судороги.', 'Кордиамин (важно применять в первые 3 дня) – подкожно или в мышцу по 0,1-0,12 мл/кг. Сульфокамфокаин – 0,3-0,5 мл дважды в день внутримышечно. Эуфиллин – 0,1-0,2 мл/кг веса подкожно. Но-Шпа (дротаверин) – по 1/3 таблетки однократно на ночь. Гамавит – подкожно по 2 мл 1-2 раза в день. Катозал – внутримышечно, подкожно или в вену по 0,5-2,5 мл, в зависимости от размеров особи и ее состояния. Тиотриазолин – по ¼ таблетки или 0,5 мл раствора в мышцу кошкам до 3 кг или по ½ таблетки или 1 мл раствора внутримышечно, если тяжелее 3 кг. Дважды в день. Нейромидин 1,5% – внутримышечно по 0,2 мл для особей с весом до 5 кг однократно в сутки. Церебролизин – 0,5-1 мл на животное однократно в день в бедро. Мексидол-Вет – 10-15 мг/кг 1-3 раза в сутки, в зависимости от тяжести состояния. Пирацетам – по 0,5-1 мл внутримышечно однократно в день. Фуросемид – 0,5-1 мг/кг подкожно или внутримышечно. Торасемид – 0,05-0,1 мг/кг однократно в сутки. Лучше использовать фуросемид, т.к. часто к торасемиду кошки не чувствительны. Глюкоза 5% — внутривенно по 15-20 мл раз в день в зависимости от веса животного. Дексаметазон (при тяжелом состоянии) – схема на 8 дней: 2 дня внутримышечно по 0,4 мл, 2 дня – 0,3 мл, 2 дня – 0,2 мл и 2 дня – 0,1 мл один раз в сутки. Пентоксифиллин (строго в стационаре под контролем ветврача) – 4,5-5 мг/кг внутрь в виде таблеток до 3-х раз в сутки или внутримышечно 0,1-0,3 мл на одно животное. Церукал (метоклопрамид) – 0,3-0,7 мг/10 кг веса до 3-х раз в сутки при рвотных позывах.');
